import React from 'react';
import {StyleSheet} from "react-native";

export const globalStyles = StyleSheet.create({
    form: {
        alignSelf: 'stretch',
        marginRight: 10,
        marginLeft: 10
    },
    header: {
        alignSelf: 'stretch',
        fontSize: 20,
        padding: 10,
        marginBottom: 40,
    },
    textinput: {
        alignSelf: 'stretch',
        height: 40,
        marginBottom: 20,
        borderBottomColor: '#9b9b9b',
        borderBottomWidth: 1
    },
    errorText: {
        color: '#D50000',
        fontWeight: 'bold',
        marginBottom: 8,
        textAlign: 'center'
    },
    button: {
        marginLeft: 60,
        marginRight: 60,
        alignItems: 'center',
        padding: 20,
        backgroundColor: '#D50000',
        marginTop: 30
    },
    buttonText: {
        color: '#fff',
        fontWeight: 'bold'
    },
});
